import React from "react";
import { Home } from "./Home";
import { BrowserRouter, Routes, Route } from "react-router-dom";

export const Landing = () => {
  return (
    <div>
      {/* <Home /> */}
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Smallnav />} />
          <Route path="/item-detail" element={<ItemDetail />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};
